Chuyện là hôm qua 11/03/2018 vk ck mình có việc tại khu vực Thái Hà, trong lúc chờ đợi công việc đến tới 3h nữa nên 2 vc quyết định NN thẳng tiến, check trên TĐ thấy có địa chỉ 169 Đông Các ( KS Phú Nhuận) phòng ốc ok. Gọi điện buzz phòng có đầy đủ ghế Sofa, ghế Tantra,… Nói chung đủ điều kiện vui vẻ.

Khi đến phòng không được như mình ưng ý lắm vì bóng đèn hơi tối, điều hòa thì cũ kỹ, bật thì lạnh, tắt thì nóng. Nhưng ko sao, tinh thần đang phấn khích, vk mình làm kiểu ảnh với chiếc áo bị thủng nhiều chỗ trước khi làm công tác chuẩn bị

Vk mình vào tắm trước trong khi mình hẹn 1 mem TĐ đã có mặt trước ở đó và chuẩn bị ok rồi. Khi bx ra mình dùng 1 chiếc khăn bịt mắt lại và nt cho mem TĐ bước vào phòng. Thực ra mình định chơi trò “Bịt mắt bắt chim” nhưng kế hoạch ko thành công do bx biết. Nhưng mọi chuyện đến thì nhất định sẽ phải đến, mình sẽ nói nốt bằng hình ảnh nhé. Mọi người đọc cho mình comment thật hay để vk ck mình hiểu được cảm giác của các đồng dâm nhé.

